import { Container } from "react-bootstrap";
import Header from "./Header";

function Layout({ children }) {
  return (
    <>


      <div class="wrapper">
        <Header />
        <Container fluid>
          {children}
        </Container>

      </div>
    </>
  );
}

export default Layout;
